import Matematika from "../assets/matematika.svg";
import PenalaranUmum from "../assets/penalaranUmum.svg";
import PengetahuanUmum from "../assets/pengetahuanUmum.svg";
import BacaanMenulis from "../assets/bacaanMenulis.svg";
import Kuantitatif from "../assets/kuantitatif.svg";
import Literasi from "../assets/literasi.svg";

export const allMateri = [
  {
    id: "1",
    title: "Penalaran Umum",
    svg: PenalaranUmum,
  },
  {
    id: "2",
    title: "Pengetahuan dan Pemahaman Umum",
    svg: PengetahuanUmum,
  },
  {
    id: "3",
    title: "Pemahaman Bacaan dan Menulis",
    svg: BacaanMenulis,
  },
  {
    id: "4",
    title: "Pengetahuan Kuantitatif",
    level: 3,
    svg: Kuantitatif,
  },
  {
    id: "5",
    title: "Literasi",
    svg: Literasi,
  },
  {
    id: "6",
    title: "Penalaran Matematika",
    svg: Matematika,
  },
];
